import React from "react";
import './tailwind.css';
import { Routes, Route } from 'react-router-dom';
import Myprovider from "./context/Myprovider";
import LoginPage from './pages/login';
import { Signup } from "./components/Signup-Login";
import Home from "./components/home";
import DonersData from "./components/ome"; // Correct the import if needed
import Hero from "./components/Herosec";
import Reciever from "./components/Reciever";

function App() {
  return (
    <Routes>
      {/* Route for the Signup page */}
      <Route path="/" element={<Signup />} />

      {/* You can add other routes for different pages */}
      <Route path="/login" element={<LoginPage />} />
      <Route path="/home" element={<Home />} />
      <Route path="/" element={<DonersData />} />
      <Route path="/reciever" element={<Reciever />} />
      <Route path="/hero" element={<Hero />} />
    </Routes>
  );
}

export default App;
